INSERT INTO `devices` VALUES (1,'Modem ADSL Wi-Fi','Navigazione veloce e senza fili\n\nCon il Modem ADSL Wi-Fi navighi ad alta velocit√† e senza fili, utilizzando l\'interfaccia Wi-Fi o attraverso le 4 porte Ethernet.\n\n    Navigazione pi√π veloce grazie alla tecnologia senza fili Wi-Fi e migliore copertura della rete Wi-Fi della tua abitazione.\n    Protezione: la cifratura WPA e WPA2 impedisce l‚Äôaccesso ai non autorizzati alla rete Wi-Fi. Disponibili anche funzionalit√† avanzate come il filtro degli indirizzi MAC ed il firewall integrato.\n    Tutta la famiglia connessa: collega tutti i PC, smartphone e tablet al nuovo modem ADSL Wi-Fi e inoltre condividi Hard Disk e stampanti collegati alla porta USB del modem.\n    Installazione no problem: il modem si configura automaticamente sulla tua linea ADSL, senza installare software.\n    Risparmia sulla bolletta elettrica: il nuovo modem, rispetto ad un prodotto Telecom Italia di generazione precedente con le stesse funzionalit√†, consente di risparmiare fino al 40% di energia elettrica su un utilizzo medio annuo.\n\nIl Modem Wi-Fi opera solo su linea ADSL di Telecom Italia ed √® compatibile con i principali sistemi operativi (Windows 7, Vista, XP - MacOS 10.3).','Tecnologia\n\nADSL/ADSL2+; velocit√† fino a 20 Mbps down/1 Mbps up\n\n\nWi-Fi\n\nWi-Fi 802.11 b/g/n; velocit√† di trasferimento fino a 300Mbps\n\n\nInterfacce\n\nInterfacce USB alta velocit√† (480 Mbit/s) ad alta potenza (500 mA), 1 porta connettore tipo A Interfaccia Wi-FiStandard IEEE 802.11nInterfaccia radio 2.4Ghz, 2 antenne, velocit√† di trasmissione teorica 300 Mbps\n\n\nProtezione Wireless\n\nWPA, WPA-PSK, WEP - Supporto Wi-Fi Protected Setup - Controllo di accesso\n\n\nFunzioni avanzate\n\nFunzionalit√† di routing avanzate (DHCP server, NAT, NAPT, Virtual Server) - Firewall - Condivisione Hard Disk e Stampante USB\n\n\nAssistenza tecnica\n\n2 anni di garanzia sul prodotto\n\n\nContenuto della confezione\n\nGuida di installazione; CD autoinstallante (compatibile con Windows 7, Vista, XP- MacOS 10.3); 1 filtro ADSL 2+; 1 cavo Telefonico; 1 cavo Ethernet',69.00,3,'TIM','Embedded','vendita');
INSERT INTO `devices` VALUES (2,'LG K8','La nuova serie K di LG ti offre una gamma di smartphone che rispecchiano la tua personalit√†. LG K8 ti accompagna nei tuoi viaggi e ti sorprender√† con selfie dettagliati tutti da condividere con la velocit√† della rete 4G LTE\r\n\r\nDatti un tono! LG K8 ha un design che lascia a bocca aperta grazie al profilo del vetro smussato e alla forma arrotondata. In pi√π √® pi√π ergonomico e garantisce una presa pi√π salda grazie alla lavorazione della cover posteriore. \r\n\r\nCattura i le situazioni pi√π divertenti della giornata con la fotocamera da 8 Megapixel. E\' sufficiente un tocco sul display e K8 mette a fuoco e scatta immediatamente. Anche per i selfie puoi contare sulla fotocamera frontale da 5 Megapixel con la funzione flash virtuale che illumina il tuo volto, cos√¨ i tuoi selfie saranno illuminati come si deve, mentre tutti gli altri... scatteranno selfie scuri! \r\n\r\nGuarda le tue foto e i tuoi video sul display ampio da ben 5\".','Tecnologia\r\n\r\n4G cat.4/HSDPA42/UMTS/EDGE/GPRS Frequenze 850/900/1800/1900/2100\r\n\r\n\r\nConnettivita\r\n\r\nWi-Fi - Bluetooth - Micro USB - NFC\r\n\r\n\r\nGPS\r\n\r\nIntegrato\r\n\r\n\r\nDisplay\r\n\r\n5‚Äù 16 Milioni colori Touch\r\n\r\n\r\nFotocamera\r\n\r\nPosteriore da 8 Mpxl con flash\r\n\r\n\r\nMemoria Interna\r\n\r\n8GB con Slot Memory Card Micro SD fino a 32GB\r\n\r\n\r\nProcessore\r\n\r\nProcessore QuadCore 1.3 GHz\r\n\r\n\r\nFormato SIM\r\n\r\nNano-sim\r\n\r\n\r\nAudio e Video\r\n\r\nVideo Recorder&Playback - MP3 Player - Radio FM\r\n\r\n\r\nIn dotazione\r\n\r\nCaricabatteria, Cavo dati USB, Manuale d‚Äôuso rapido, Auricolare stereo\r\n\r\nDimensioni\r\n\r\n144,6x71,5x8,7 mm\r\n\r\n\r\nPeso\r\n\r\n142 gr.\r\n\r\n\r\nAutonomia(*)\r\n\r\nStand-by fino a 100 ore - ‚Ä®Conversazione fino a 240 min. ',179.90,1,'LG','android','vendita');
INSERT INTO `devices` VALUES (3,'Apple iPhone SE','Il telefono da 4\" pi√π potente di sempre. iPhone SE riprende un design compatto di grande successo aggiungendovi due fotocamere evolute e una potenza di elaborazione incredibile.Disegnato per stare comodamente in mano e risultare piacevole al tatto, grazie alla finitura satinata del guscio in alluminio microsabbiato.\r\n\r\niPhone SE ha un display Retina da 4‚Äô‚Äô, chip A9 con archittetura a 64 bit di livello desktop, sensore di impronte digitali Touch ID, fotocamera iSight da 12MP, videocamera FaceTime HD con Retina flash, Live Photos e connessioni Wi-Fi e 4G veloci. E ancora, iOS 9 e iCloud.','Display\r\n\r\nRetina Multi-Touch widescreen retroilluminato LED da 4\" (diagonale) 1136x640 pixel a 326 ppi\r\n\r\n\r\nProcessore\r\n\r\nChip A9 con architettura a 64 bit, Coprocessore di movimento M9 integrato\r\n\r\n\r\nFotocamera\r\n\r\nFotocamera iSight da 12 megapixel\r\n\r\n\r\nVideocamera\r\n\r\nFaceTime HD\r\n\r\n\r\nSensori\r\n\r\nSensore di impronte digitali Touch ID\r\n\r\n\r\nConnettivita\r\n\r\n4G LTE1\r\n\r\nSistemaOperativo\r\n\r\niOS 9 e iCloud\r\n\r\n\r\nColori\r\n\r\nDisponibile in Space Grey, Silver, Gold e Rose Gold',509.90,1,'apple','iOS','vendita');
INSERT INTO `devices` VALUES (4,'Samsung Galaxy S6','Traendo ispirazione dagli artisti della forma, come i mastri vetrai ed i fabbri di bottega, Samsung Galaxy S6 √® il perfetto incontro di materiali finemente forgiati tra loro. Una rivelazione senza precedenti fatta non solo di straordinaria forma e dalle superfici lucenti, ma anche di eccellente sostanza con un ampio spettro di colori ancora pi√π vibranti.\r\n\r\nOvunque tu sia potrai catturare al meglio ogni momento, ed ogni suo dettaglio, grazie alla fotocamera anteriore e posteriore di Samsung Galaxy S6, con risoluzione maggiore ed un obiettivo F1.9. Baster√† un semplice doppio click per attivare la fotocamera e fissare i tuoi istanti, per sempre.','Tecnologia\r\n\r\n4G cat.6/HSDPA42/UMTS/EDGE/GPRS Frequenze 850/900/1800/1900/2100\r\n\r\n\r\nConnettivita\r\n\r\nWi-Fi - Bluetooth - Micro USB - NFC\r\n\r\n\r\nGPS\r\n\r\nIntegrato\r\n\r\n\r\nDisplay\r\n\r\n5.1‚Äù 16 Milioni colori Touch\r\n\r\n\r\nFotocamera\r\n\r\n16 Mpixel/Flash\r\n\r\n\r\nMemoria Interna\r\n\r\n32GB\r\n\r\n\r\nProcessore\r\n\r\nOctaCore: (QuadCore 2.1 Ghz+QuadCore 1.5 Ghz)\r\n\r\n\r\nFormato SIM\r\n\r\nNano\r\n\r\n\r\nVideo\r\n\r\nVideo Recorder&Playback\r\n\r\n\r\nMusica\r\n\r\nMP3 Player\r\n\r\n\r\nIn dotazione\r\n\r\nCaricabatteria - Cavo Dati MicroUSB - Auricolare stereo - Guida di riferimento rapido\r\n\r\n\r\nDimensioni\r\n\r\n143,4x 70,5x 6,8 mm\r\n\r\n\r\nPeso\r\n\r\n138 gr.\r\n\r\n\r\nAutonomia(*)\r\n\r\nStand-by fino a 490 ore - Conversazione fino a 1020 min',639.90,1,'samsung','android','vendita;a rate');
INSERT INTO `devices` VALUES (5,'Huawei P9 Plus','L‚Äôesperienza di Huawei P9 si eleva ad un livello superiore con Huawei P9 Plus grazie al luminoso display da 5.5‚Äù e l‚Äôelegante corpo in metallo\r\n\r\nGrazie al perfetto connubio tra hardware e software di classe superiore della doppia fotocamera Leica, P9 Plus consente di catturare immagini di assoluta qualit√† senza rinunciare al design compatto ed elegante.','Tecnologia\r\n\r\nAbilitato tecnologia 4G/HSPA+/EDGE/GPRS Frequenze 850/900/1800/1900MHz\r\n\r\n\r\nConnettivita\r\n\r\n4G cat.4/HSPA+/EDGE/GPRS Frequenze 850/900/1800/1900Wi-Fi 802.11 a/b/g/n/ac Wi-Fi Direct, Bluetooth 4.1, NFC, Sensore d\'impronta\r\n\r\n\r\nGPS\r\n\r\nGPS Integrato, A-GPS, Glonass, BeiDou\r\n\r\n\r\nDisplay\r\n\r\nDisplay Full HD Amoled da 5.5‚Äô‚Äô‚Äô\r\n\r\n\r\nFotocamera\r\n\r\nDoppia Fotocamera Leica da 12 Mpxl Dual Flash + anteriore da 8 Mpxl\r\n\r\n\r\nMemoria Interna\r\n\r\n4GB, Micro SD fino a 128 GB\r\n\r\n\r\nProcessore\r\n\r\nProcessore Kirin 955 - Octa-Core (4x2,5 GHz + 4x1,8 GHz)\r\n\r\n\r\nIn dotazione\r\n\r\nSmartphone Auricolari stereo - Caricabatteria Cavo USB Type-C - Estrattore SIM Guida rapida\r\n\r\n\r\nDimensioni\r\n\r\n152.3 x 75.3 x 6.98 mm\r\n\r\n\r\nPeso\r\n\r\n162 grammi',749.90,1,'huawei','android','vendita');
INSERT INTO `devices` VALUES (6,'Sirio Maxi','Il nuovo Sirio Maxi √® un telefono moderno, dotato di indicatore luminoso di chiamata in arrivo, ampio display grafico, rubrica e vivavoce.\r\n\r\nHa tasti grandi ed un ampio display, funziona senza batterie ed alimentatore anche in caso blackout, √® elegante ed ergonomico, con il servizio \"CHI √à\" attivo offre la possibilit√† di visualizzare il numero del chiamante.','Display\r\n\r\nAmpio schermo con caratteri grandi su tre righe - Visualizzazione del numero Chiamante (con CHI √à attivo)\r\n\r\n\r\nTastierino\r\n\r\nTasti grandi e leggibili\r\n\r\n\r\nAvvisi\r\n\r\nIndicatore luminoso di chiamata in arrivo\r\n\r\n\r\nTecnologia\r\n\r\nFunziona senza batterie e alimentatore\r\nChiamata diretta (Baby Call) - Preselezione del numero con possibilit√† di correzione\r\n\r\n\r\nAudio\r\n\r\nVolume in ascolto regolabile con un singolo tasto (alto-basso) - Vivavoce con comodo regolatore di volume - Muto e Messa in attesa della chiamata con musica\r\n\r\n\r\nRubrica\r\n\r\nRubrica 125 contatti - 12 numeri programmabili in selezione abbreviata\r\n\r\n\r\nLingua\r\n\r\nMenu 8 lingue',39.90,1,'TIM','embedded','vendita;a rate');
INSERT INTO `devices` VALUES (7,'Sirio Classico','Con Sirio Classico torna il Telefono di casa, ma con quante novit√†!\r\n\r\nLe forme originarie sono state interpretate in modo profondamente innovativo creando delle aperture che donano all\'insieme eleganza e leggerezza e lo rendono adatto ad essere armoniosamente integrato in ogni ambiente.\r\n\r\nSirio Classico √® anche un telefono moderno, dotato di display grafico, rubrica, vivavoce; un ottimo telefono e un oggetto d\'arredamento che rispetta l\'ambiente, perch√© non usa n√© batterie n√© alimentatore.\r\n\r\nE per la comodit√† delle telefonate domestiche abbiamo pensato anche ad un cavo cornetta extra lungo, ben oltre tre metri nella sua massima estensione.\r\n\r\nAcquista Sirio Classico direttamente su questo sito. Lo riceverai a casa tua in consegna gratuita.','Tipo di telefono\r\n\r\ncon filo\r\n\r\n\r\nDisplay\r\n\r\ngrafico a matrice di punti a due righe alfanumeriche\r\n\r\n\r\nData e ora a display\r\n\r\nsi\r\n\r\n\r\nLingue didponibili\r\n\r\nitaliano, inglese, francese, spagnolo, olandese, portoghese, tedesco\r\n\r\n\r\nSuoneria\r\n\r\n10 suonerie\r\n\r\n\r\nVolume suoneria\r\n\r\n3 livelli di volume + silenzioso\r\n\r\n\r\nVisualizzazione durata conversazione\r\n\r\nsi\r\n\r\n\r\nVisualizzazione numero chiamante\r\n\r\nsi, dopo aver attivato il servizio Chi √®\r\n\r\n\r\nIdentificativo Chiamante\r\n\r\nlista ultime 20 chiamate perse/ricevute\r\n\r\n\r\nVivavoce\r\n\r\nsi\r\n\r\n\r\nAgenda\r\n\r\nno\r\n\r\n\r\nRubrica\r\n\r\n50 numeri e nomi\r\n\r\n\r\nSegreteria Telefonica\r\n\r\nno\r\n\r\n\r\nSveglia\r\n\r\nsi\r\n\r\n\r\nLettore carta SIM\r\n\r\nno\r\n\r\n\r\nTastiera\r\n\r\nnumerica + tasti funzione\r\n\r\n\r\nTasti dedicati sulla tastiera\r\n\r\ntasto vivavoce, tasto accesso a lista chiamate effettuate, tasto mute, tasto R\r\n\r\n\r\nRipetizione numeri\r\n\r\nultime 10 chiamate ricevute\r\n\r\n\r\nSelezione Rapida\r\n\r\nno\r\n\r\n\r\nTasto mute/attesa\r\n\r\ns√¨\r\n\r\n\r\nPreselezione\r\n\r\nsi\r\n\r\n\r\nFotocamera\r\n\r\nno\r\n\r\n\r\nInvio/ricezione SMS, e-mail e fax\r\n\r\nno\r\n\r\n\r\nInvio/ricezione MMS\r\n\r\nno\r\n\r\n\r\nVIP List\r\n\r\nno\r\n\r\n\r\nGiochi\r\n\r\nno\r\n\r\n\r\nSicurezza\r\n\r\nno\r\n\r\n\r\nBatteria\r\n\r\nno\r\n\r\n\r\nRoom Monitoring\r\n\r\nno\r\n\r\n\r\nAltre funzioni\r\n\r\ntono tasti attivabile o disattivabile da menu\r\n\r\n\r\nDimensioni\r\n\r\n226 x 187 x 128 mm\r\n\r\n\r\nPeso\r\n\r\nbase + cornetta: 0.605 kg; prodotto e accessori: 0.992 kg\r\n\r\n\r\nContenuto confezione\r\n\r\ntelefono, cornetta telefonica, cavo di collegamento cornetta molto lungo (85 spire, allungabile fino a 360 cm), cavo di collegamento presa tripolare, spina di tipo tripolare',39.90,1,'TIM','embedded','vendita;a rate');
INSERT INTO `devices` VALUES (8,'Apple iPad Pro','Con iPad hai scoperto un mondo completamente nuovo, semplice e coinvolgente. Oggi iPad Pro, con la tecnologia Multi‚ÄëTouch perfezionata, il suo grande display Retina da 12,9\" e prestazioni della CPU quasi raddoppiate rispetto a iPad Air 2, √® pronto ad allargare ancora una volta i tuoi orizzonti. Non √® solo pi√π grande. √à un iPad che ti permetter√† di lavorare e creare in una dimensione tutta nuova, come non hai mai fatto prima.\n\nCon 5,6 milioni di pixel, iPad Pro ha il display Retina a pi√π alta risoluzione mai visto su un dispositivo iOS. Montare video 4K, creare presentazioni, gestire un‚Äôazienda: sul display da 12,9\" tutto √® pi√π facile, veloce e coinvolgente. E con il Multi‚ÄëTouch riprogettato scoprirai nuovi modi per interagire con il tuo iPad.\n\nNonostante il suo grande display, iPad Pro √® sorprendentemente sottile e leggero: solo 6,9 mm di spessore e appena 713 grammi. Grazie al guscio unibody, √® anche resistente e ben bilanciato. Ma forse l‚Äôaspetto pi√π incredibile di iPad Pro √® un altro: √® talmente comodo che quasi ti dimentichi di averlo in mano','Sistema Operativo \r\n\r\niOS 9\r\n\r\n\r\nDisplay\r\n\r\nRetina Display 12.9‚Äù (2732x2048)\r\n\r\n\r\nSensori\r\n\r\nimpronte digitali Touch ID\r\n\r\n\r\nProcessore\r\n\r\nco-processore M9\r\n\r\n\r\nFotocamera\r\n\r\niSight da 8MP\r\n\r\n\r\nVideocamera\r\n\r\nFaceTime HD\r\n\r\n\r\nConnettivita\r\n\r\nLTE /HSDPA-DC 42.2/HSUPA 5.76/, Wi-Fi 802.11a/b/g/n/ac e MIMO, Bluetooth 4.2\r\n\r\n\r\nBatteria\r\n\r\nFino a 10 ore di autonomia',1249.90,2,'apple','iOS','vendita');
INSERT INTO `devices` VALUES (9,'D-Link SmartHome Starter Kit ','Con lo Smart Home HD Starter Kit potrai impostare, controllare, monitorare e automatizzare la tua casa ovunque ti trovi.\r\n\r\nNel Kit sono inclusi:\r\n\r\n    Un Monitor HD (DCS-935L) \r\n    Un Wi-Fi Motion Sensor (DCH-S150)\r\n    Una smart plug (DSP-W215) \r\n\r\nTramite l\'App mydlink Home per smartphone e tablet hai a disposizione il controllo di tutti i dispositivi cos√¨ da semplificarti la gestione della casa rendendola pi√π sicura e intelligente.','Accensione e spegnimento dei dispositivi\r\n\r\nAccendi o spegni i dispositivi usando la app mydlink‚Ñ¢ Home sul tuo smartphone o tablet iOS o Android, ovunque ti trovi.\r\n\r\n\r\nPianificazione\r\n\r\nCrea pianificazioni di accensione/ spegnimento per far funzionare i tuoi elettrodomestici quando vuoi.\r\nProtezione degli elettrodomestici\r\nIl sensore termico integrato spegne \r\nautomaticamente le prese elettriche \r\nsurriscaldate, cos√¨ non avrai pensieri.\r\n\r\n\r\nRimani al corrente\r\n\r\nInvia avvisi automatici per informare che un elettrodomestico √® stato acceso o spento, quando viene raggiunto il limite di consumo energetico o se un elettrodomestico non funziona correttamente e si surriscalda.\r\n\r\n\r\nVisualizzazione da qualsiasi luogo\r\n\r\nVisualizza in modo sicuro usando \r\nInternet attraverso il tuo smartphone \r\no tablet. Funziona con smartphone e \r\ntablet iOS e Android attraverso la app \r\nmydlink‚Ñ¢ Home1.\r\n\r\n\r\nAlta definizione\r\n\r\nControlla la tua casa in HD 720p. \r\nGuarda tutto nel dettaglio, persino \r\nquando l\'immagine √® ingrandita.\r\n\r\n\r\nVisione notturna\r\n\r\nLa funzione di visione notturna ti \r\nconsente di vedere fino a 5 metri \r\nanche in completa oscurit√†\r\n\r\n\r\nRilevazione di movimento e suoni\r\n\r\nTi avvisa mediante notifica push \r\nogni volta che viene rilevato un \r\nmovimento o un suono.\r\n\r\n\r\nAmpia copertura\r\n\r\nRilevazione dei movimenti fino a 8 \r\nmetri (100¬∞ orizzontale/ 80¬∞ verticale).',159.90,4,'D-link','embedded','vendita;a rate');
INSERT INTO `devices` VALUES (10,'Apple Watch Sport 38','Ogni collezione di Apple Watch eÃÄ realizzata con leghe speciali, studiate per unire estetica e robustezza. La cassa di Apple Watch Sport eÃÄ in alluminio anodizzato color argento, grigio siderale, oro oppure oro rosa, mentre nei modelli Apple Watch eÃÄ in acciaio inossidabile colore naturale o nero siderale. La cassa eÃÄ disponibile in due misure: 38 mm e 42 mm. Abbiamo anche creato una gamma di cinturini intercambiabili in materiali esclusivi. Apple Watch usa tecnologie rivoluzionarie come la Digital Crown, il Taptic Engine e il Force Touch. E grazie a una batteria che dura fino a 18 ore, puoi usarlo tutto il giorno.','\r\n\r\nDisplay\r\n\r\nVetro Ion-X\r\n\r\nDisplay Retina con Force Touch\r\n\r\n\r\nSensori\r\n\r\nCardiofrequenzimetro\r\n\r\nAccelerometro\r\n\r\nGiroscopio\r\n\r\nSensore di luce ambientale\r\n\r\n\r\nConnettivita\r\n\r\nWi-Fi (802.11b/g/n a 2,4GHz)\r\n\r\nBluetooth 4.0\r\n\r\n\r\nBatteria\r\n\r\nFino a 18 ore di autonomia*\r\n\r\nResistenza all\'acqua\r\n\r\nSi',369.90,4,'Apple','iOS','vendita;a rate');
INSERT INTO `devices` VALUES (11,'Samsung Galaxy TabPro S 12','DESIGN SOTTILE&LEGGERO\r\n\r\nGalaxy TabPro S rappresenta il perfetto connubio tra design e tecnologia. Estremamente sottile e leggero, stupisce per la ricercatezza dei dettagli e la qualit√† dei materiali.\r\nELEGANTE PROTEZIONE\r\n\r\nLa book cover protegge perfettamente Galaxy TabPro S, mantenendone intatta l\'eleganza.\r\nDISPLAY SUPER AMOLED\r\n\r\nGalaxy TabPro S √® il primo prodotto Windows 10 al mondo dotato di display SUPER AMOLED. Lavorare in mobilit√† √® davvero comodo, grazie al display touchscreen da 12 pollici. Indipendentemente dal contenuto visualizzato, che sia una immagine o un video, i colori e la brillantezza delle immagini saranno esaltate dalla definizione e dalla qualit√† del display SUPER AMOLED di Galaxy TabPro S\r\nINTRATTENIMENTO XBOX ONE GAME STREAMING\r\n\r\nCon questa rivoluzionaria funzione, utilizzando la stessa connessione WiFi, potrai giocare in streaming ai giochi della tua XBOX ONE direttamente su Galaxy TabPro S.','\r\n\r\nConnettivita\r\n\r\nUSB 3.1 (C-type), Bluetooth 4.1, Wi-Fi 802.11 802.11 a/b/g/n/ac (MIMO), GPS + GLONASS, NFC, Wi-Fi Direct, Connettore da 3.5 mm per auricolare, Scheda nanoSIM\r\n\r\n\r\nDisplay\r\n\r\nDisplay 12‚Äù FHD+, 2160x1440 SuperAmoled\r\n\r\n\r\nDimensioni\r\n\r\n290.3x198.8x6.3 mm\r\n\r\n\r\nPeso\r\n\r\n698 gr\r\n\r\n\r\nAutonomia\r\n\r\n600 minuti\r\n\r\n\r\nFotocamera\r\n\r\nFotocamera (Front: 5 MP Back: 5 MP)\r\n\r\n\r\nFormati supportati\r\n\r\nVideo: MP4,3GP,WMV,ASF,AVI,MKV\r\nAudio: MP3,AAC,WAV,WMA,AMR,FLAC\r\n\r\n\r\nMemoria\r\n\r\n128GB SSD, 4GB di Ram\r\n\r\n\r\nProcessore\r\n\r\nProcessore Intel Core M3 (Dualcore 2.2 GHz)\r\n\r\n\r\nSistemaOperativo\r\n\r\nWindows 10 Pro\r\n\r\n\r\nApplicazioni\r\n\r\nMicrosoft Services: Maps, OneDrive, Windows Store, Music, Film & TV, Xbox, Money, Meteo, Notizie\r\nMicrosoft Apps: Word, Excel, PowerPoint, OneNote, Edge browser\r\nIntegrazione completa con il tuo Smartphone Galaxy (disponibile da fine Marzo 2016):\r\n- Autenticazione con impronte digitali\r\n- Sincronizzazione delle notifiche\r\n- Hotspot Wi-Fi automatico\r\n\r\n\r\nIn confezione\r\n\r\nCarica batteria, Cavo dati Usb, Manuale d‚Äôuso',1299.90,2,'samsung','windows','vendita');
INSERT INTO `devices` VALUES (12,'Samsung Galaxy View 18.4\" LTE','Design sottile e moderno\r\nLo stile essenziale e la cornice metallizzata esaltano il nuovo formato 4:3, donando a Galaxy View un look moderno e sofisticato, garantendo la massima maneggevolezza grazie ai 7,5 millimetri di spessore e solo 456 grammi di peso.\r\nEsperienza visiva ottimizzata\r\nProgettato per essere il tablet pi√π portatile della categoria, Galaxy View non accetta compromessi, regalandoti uno schermo pi√π ampio rispetto ad altri tablet. Un nuovo display, ideale per visualizzare in modo ottimale presentazioni, siti web, pubblicazioni, e-book ed e-mail.\r\nFoto perfette con Auto Focus\r\nLa fotocamera da 5 MP con messa a fuoco automatica permette di ottenere immagini sempre chiare e definite con la massima semplicit√† e in qualsiasi condizione. √à anche possibile eseguire facilmente scansioni di codici QR e codici a barre migliorando l\'interazione con il mondo che ti circonda.\r\nInteressanti contenuti e servizi gratuiti\r\nL\'esperienza di GALAXY View √® arricchita dai numerosi contenuti disponbili per te. Potrai leggere le tue riviste preferite grazie ai 6 mesi inclusi con MagBox e goderti un fantasitico e-book al mese per un anno con Kindle for Samsung.\r\nPrestazioni eccellenti\r\nGrazie al processore Quad Core da 1.2GHz, 2GB di RAM, alla versione pi√π recente di Android Lollipop e alla funzione Multischermo, √® il dispositivo perfetto per chi prova per la prima volta un Tablet e per chi cerca un prodotto performante.','\r\n\r\nConnettivita\r\n\r\nConnettivit√† WirelessBluetooth 4.1, BLEWi-Fi 802.11 a/b/g/n/ac\r\n\r\n\r\nDisplay\r\n\r\nDisplay 18.4‚Äù TFT PLS ,1920x1080 Full HD\r\n\r\n\r\nDimensioni\r\n\r\n451,8x275,8x11,9 mm.\r\n\r\n\r\nPeso\r\n\r\n2,65 kg\r\n\r\n\r\nFotocamera\r\n\r\nFotocamera (Front: 2.1 MP)\r\n\r\n\r\nFormati supportati\r\n\r\nLettore multimediale, aac,amr,awb,mp3,ogg,wav, DivX, XviD, MPEG4, VP8, H.263, H.264, H.265\r\n\r\n\r\nMemoria\r\n\r\nInterna 32GB (espandibile fino a 128GB)\r\n\r\n\r\nProcessore\r\n\r\nOctaCore da 1.6 GHzx\\\r\n\r\n\r\nSistemaOperativo\r\n\r\nAndroidTM 5.1 (Lollipop)\r\n\r\n\r\nIn confezione\r\n\r\nCarica batteria, Manuale d‚Äôuso\r\n\r\n\r\nApplicazioni\r\n\r\nAndroid Market, Google Mobile App, Youtube, Inserimento testo e ricerca vocale, E-mail, GPS Glonass, SMS/MMS,\r\n\r\n\r\nAutonomia\r\n\r\nfino a 8h in video play',799.90,2,'samsung','android','vendita;a rate');
INSERT INTO `devices` VALUES (13,'Beats Solo2 On-Ear Headphones','Audio potenziato con la nuova qualit√† sonora Beats, il suono delle cuffie Solo2 √® pi√π nitido e pi√π pulito e sprigiona una pi√π vasta gamma di emozioni. Le cuffie Solo2 offrono un\'ampia gamma di frequenze alte e bassi profondi per un\'esperienza di ascolto equilibrata per tutti i generi musicali.\r\n\r\nVestibilit√† e stile: comfort, durevolezza e stile. Padiglioni curvati di 15 gradi per un comfort prolungato; la flessibilit√† rotazionale consente ai padiglioni di flettersi per una vestibilit√† ancor pi√π personalizzata','\r\n\r\nDimensioni\r\n\r\n156 mm (larghezza)\r\n\r\n\r\nPeso\r\n\r\n205 gr.\r\n\r\n\r\nContenuto della confezione\r\n\r\nCavo RemoteTalk‚Ñ¢, Custodia da viaggi',199.90,4,'Beats','embedded','vendita');
